oxy_webhelp_navlinks = {"tocId-d23139e41093":{"topics":[{"title":"Settings menu","shortdesc":"<p class=\"shortdesc\">You can use the <span class=\"ph\">RSC<\/span> Settings menu to access and configure the         global settings for all your Rubrik applications.<\/p>","href":"saas\/rsc_settings_menu_2.html","attributes":{"data-id":"rsc_settings_menu"},"menu":{"hasChildren":true},"tocID":"rsc_settings_menu-d23139e41102","next":"rsc_settings_menu-d23139e41102"},{"title":"Rubrik Cloud Cluster Elastic Storage","shortdesc":"<p class=\"shortdesc\">You can use <span class=\"ph\">Rubrik Security Cloud<\/span> to provision a Rubrik Cloud Cluster Elastic         Storage on AWS or a Rubrik Cloud Cluster Elastic Storage on Azure. Provisioning a Rubrik         Cloud Cluster Elastic Storage creates a virtual Rubrik Cloud Cluster running in a virtual         private cloud, providing data protection for hosts and applications.<\/p>","href":"saas\/rubrik_cc_es_on_saas.html","attributes":{"data-id":"rubrik_cc_es_on_saas"},"menu":{"hasChildren":true},"tocID":"rubrik_cc_es_on_saas-d23139e41657","next":"rubrik_cc_es_on_saas-d23139e41657"},{"title":"Multitenant organizations","shortdesc":"<p class=\"shortdesc\">Multitenancy in <span class=\"ph\">RSC<\/span> refers to the logical isolation of shared         compute, storage, and network resources in such a way that each organization can only see         and access data that belongs to that organization, especially for shared infrastructure         platforms.<\/p>","href":"saas\/mt_multitenant_organizations.html","attributes":{"data-id":"mt_multitenant_organizations"},"menu":{"hasChildren":true},"tocID":"mt_multitenant_organizations-d23139e42053","next":"mt_multitenant_organizations-d23139e42053"},{"title":"Multitenancy and Rubrik Envoy","shortdesc":"<p class=\"shortdesc\">With Rubrik Envoy, you can enable secure data movement between Rubrik clusters and a         tenant organization network.<\/p>","href":"cdm\/multitenancy_and_rubrik_envoy.html","attributes":{"data-id":"multitenancy_and_rubrik_envoy"},"menu":{"hasChildren":true},"tocID":"multitenancy_and_rubrik_envoy-d23139e42359","next":"multitenancy_and_rubrik_envoy-d23139e42359"}]}};